const INSTANCE_SIZE = 255;
const EXEMPLAR_SIZE = 255;
const CONST_CONTEXT = 0.5;
const SCORE_SIZE = 33;
const TOTAL_STRIDE = 4.0;
const RESPONSE_UP = 8.0;
const UPSCALE_SZ = RESPONSE_UP * SCORE_SIZE;
const MARGIN = 16;

const Z_LR = 5e-3;

const SCALE_LR = 0.52;
const SCALE_FACTORS = [0.9456, 1.0, 1.0575];
const SCALE_PENALTY = 0.9780;
// Don't search more than 5 times the initial box size either way
const MIN_S_FACTOR = 0.2;
const MAX_S_FACTOR = 5;

//const SCALE_FACTORS = [1.0];
const WINDOW_INFLUENCE = 0.2625;
const AVG = {
  r: 124,
  g: 117,
  b: 104
}

// #region CF_TARGET
const CF_TARGET = ''

//#endregion CF_TARGET

function createHanningWindow(sz, normalize=false) {
  return tf.tidy(() => {
    const hann1d = tf.signal.hannWindow(sz);
    let _window= tf.outerProduct(
        hann1d,
        hann1d
    );
    if (normalize) {
      _window = _window.div(_window.sum());
    }
    return tf.expandDims(_window, -1);
  });
}

// Source: https://gitlab.com/vgg/followme1/-/blob/siamfc_on_browser/src/js/henriques2015highspeed.js#L139
// 2D FFT is equaivalent to taking FFT of each row
// followed by taking the FFT of each column (or vice versa)
const _fft2 = function(x) {
  return tf.tidy(() => {
    var x_row_fft = tf.spectral.fft( tf.complex(x, tf.zerosLike(x)) );
    var x_row_fft_real = tf.real(x_row_fft).reshape(x.shape);
    var x_row_fft_imag = tf.imag(x_row_fft).reshape(x.shape);
    var x_row_fft_transpose = tf.complex(
        x_row_fft_real.transpose([0, 2, 1]),
        x_row_fft_imag.transpose([0, 2, 1])
    ); // needed as tf.transpose() does not work with complex64

    var x_fft_transpose = tf.spectral.fft( x_row_fft_transpose );
    var x_fft_transpose_real = tf.real(x_fft_transpose).reshape(x_row_fft_transpose.shape);
    var x_fft_transpose_imag = tf.imag(x_fft_transpose).reshape(x_row_fft_transpose.shape);
    var x_fft = tf.complex(
        x_fft_transpose_real.transpose([0, 2, 1]),
        x_fft_transpose_imag.transpose([0, 2, 1])
    );
    return x_fft;
  });
}
  
// 2D FFT is equaivalent to taking FFT of each row
// followed by taking the FFT of each column (or vice versa)
const _ifft2 = function(x_fft) {
  return tf.tidy(() => {
    var x_row_ifft = tf.spectral.ifft(x_fft);
    var x_row_ifft_real = tf.real(x_row_ifft).reshape(x_row_ifft.shape);
    var x_row_ifft_imag = tf.imag(x_row_ifft).reshape(x_row_ifft.shape);
    var x_row_ifft_transpose = tf.complex(
        x_row_ifft_real.transpose([0, 2, 1]),
        x_row_ifft_imag.transpose([0, 2, 1])
    ); // needed as tf.transpose() does not work with complex64

    var x_ifft_transpose = tf.spectral.ifft( x_row_ifft_transpose );
    var x_ifft_transpose_real = tf.real(x_ifft_transpose).reshape(x_ifft_transpose.shape);
    var x_ifft_transpose_imag = tf.imag(x_ifft_transpose).reshape(x_ifft_transpose.shape);
    var x_ifft = tf.complex(
        x_ifft_transpose_real.transpose([0, 2, 1]),
        x_ifft_transpose_imag.transpose([0, 2, 1])
    );
    return x_ifft;
  });
}
  
function correlationFilter(x, y) {

  // References
  // 1. https://github.com/bertinetto/cfnet/blob/971e7922b7f0f9140e0d995b598e8d97dece277c/src/util/corr_filter.m
  // 2. https://github.com/Wenju-Huang/py-CFNet/blob/master/src/siamese.py#L228

  // TODO Pad to nearest power of 2 for FFT?
  const lambda = 10;
  const n = x.shape[0] * x.shape[1];

  return tf.tidy(() => {
    const one_by_n = tf.scalar(1/n);

    // Input is in HWC -> transpose to CHW and transpose the result back to HWC
    let x_f = _fft2(x.transpose([2, 0, 1]))
    x_f = tf.complex(
        tf.real(x_f).transpose([1, 2, 0]),
        tf.imag(x_f).transpose([1, 2, 0]));

    // Y is in HW
    let y_f = _fft2(tf.expandDims(y, 0));
    y_f = tf.complex(
        tf.real(y_f).transpose([1, 2, 0]),
        tf.imag(y_f).transpose([1, 2, 0])
    );

    // k_f = tf.reduce_sum(tf.multiply(tf.conj(net_z_f), net_z_f),2)  
    // k_f = tf.multiply(tf.cast(1.0/tf.cast(H*W,tf.float64),tf.complex64),k_f) + 10  
    // const k_f = tf.mul(
    //     one_by_n,
    //     x_f.mul(tf.complex(tf.real(x_f), tf.neg(tf.imag(x_f)))).sum(2)
    // ).add(lambda);

    let k_f = tf.real(
        x_f.mul(tf.complex(tf.real(x_f), tf.neg(tf.imag(x_f))))
    ).sum(2, true).mul(one_by_n).add(lambda);

    

    // K_f is now a real number matrix HW

    // a_f = tf.cast(1.0/tf.cast(H*W,tf.float64),tf.complex64)*tf.multiply(cf_target_f, 1.0/k_f)
    const a_f = k_f.reciprocal().mul(one_by_n).mul(y_f);

    // w_f = tf.multiply(tf.expand_dims(tf.conj(a_f),2), net_z_f)
    let w_f = x_f.mul(
        tf.complex(tf.real(a_f), tf.neg(tf.imag(a_f))), // conj(a_f)
    );

    /*
    # w_f are [H, W, C]
    w_f= tf.transpose(w_f, perm=[2,0,1])
    # w_f are [C, H, W]
    net_w = tf.real(tf.ifft2d(w_f))
    #net_w are [C, H, W]
    net_w = tf.transpose(net_w, perm=[1,2,0])
    #net_w are [H, W, C]
    */
    w_f = tf.complex(
        tf.real(w_f).transpose([2, 0, 1]),
        tf.imag(w_f).transpose([2, 0, 1])
    );
    
    w = tf.real(_ifft2(w_f)).transpose([1, 2, 0]);
    return w;
  });
}

class CFNet {
  constructor(model_url) {
    this.model_url = model_url;
    // Trained response window
    // loading it from params
    // TODO : Save some ms by storing FFT of this tensor
    this.cf_target = tf.tensor(
        JSON.parse(atob(CF_TARGET)),
        [57, 57],
        'float32'
    );
    this.z_window = createHanningWindow(57);
    this.hannWindow = createHanningWindow(UPSCALE_SZ, true);

    // Initialise instance head
    this.instance_model = tf.sequential();

    // TODO Change it to depthwiseconv?
    // XCorr
    this.instance_model.add(tf.layers.conv2d({
        inputShape: [57, 57, 32],
        filters: 1,
        kernelSize: 25,
        trainable: false,
        useBias: false,
    }));
    // 1 x 33 x 33 x 1

    // Fin Adjust
    this.instance_model.add(tf.layers.conv2d({
        filters: 1,
        kernelSize: 1,
        trainable: false,
        useBias: true,
    }));
    this.instance_model.layers[1].setWeights([
        tf.tensor([23.18732452392578], [1, 1, 1, 1], 'float32'),
        tf.tensor([-3.6984901428222656], [1,], 'float32')
    ]);
      // Score map now will be of size 1x33x33x1

    // Canvas for padding and resizing - can change to tf based as well
    this.inputCanvas = document.createElement('canvas');
    this.inputCtx = this.inputCanvas.getContext('2d', { alpha: false});

    // Used for scale pyramid
    this.searchCanvas = document.createElement('canvas');
    this.searchCtx = this.searchCanvas.getContext('2d', {alpha: false});

    this.padCanvas = document.createElement('canvas');
    this.padCtx = this.padCanvas.getContext('2d', { alpha: false });

    this.outputCanvas = document.createElement('canvas');
    this.outputCtx = this.outputCanvas.getContext('2d', { alpha: false });
  }

  async init_models() {
    // Load graph from URL
    this.model = await tf.loadGraphModel(this.model_url);

    // TODO Warmup the models with dummy input      
  }

  // TODO Make scale pyramid
  async get_scale_pyramid(im, center, in_side_scaled, out_side, avg) {
    const max_target_side = in_side_scaled[in_side_scaled.length-1];
    const min_target_side = in_side_scaled[0];

    // TODO Should we rewrite to resize the middle scale only once 
    // const middle_scale = in_side_scaled[Math.floor(n_scales)];

    const search_side = Math.round(out_side * max_target_side / min_target_side);

    // Get the biggest scale as this will do the maximum pad anyway
    
    this.searchCanvas.width = search_side;
    this.searchCanvas.height = search_side;
    this.searchCtx.putImageData(
        this.get_sub_image(
            im, 
            center, 
            search_side, 
            Math.round(max_target_side), 
            avg
        ),
        0, 0,
    );

    // Get all scales by cropping the relevant part from search_image
    return in_side_scaled.map((s) => {
      const target_side = Math.round(out_side * s / min_target_side);
      return tf.tidy(() => {
        return tf.expandDims(
            tf.cast(
                tf.browser.fromPixels(
                    this.get_sub_image(
                        this.searchCanvas,
                        [search_side / 2, search_side / 2],
                        out_side,
                        target_side,
                        avg,
                    )
                ),
                'float32'
            ),
        )
      });
    });

  }

  get_sub_image(im, center, model_sz, target_sz, avg) {
    // TODO - Using fixed mean. Must replace later

    // TODO - Compare with matlab - Might have 1-2 pixel difference in bounds

    // Center is in x, y format
    // Find the boundaries
    let corners = new Array(4);
    corners[0] = center[0] - ((target_sz - 1.0) / 2.0);
    corners[1] = center[1] - ((target_sz - 1.0) / 2.0);
    corners[2] = center[0] - ((target_sz - 1.0) / 2.0) + target_sz;
    corners[3] = center[1] - ((target_sz - 1.0) / 2.0) + target_sz;

    // If the boundaries go outside image, we should pad with avg
    let pads = new Array(4);
    pads[0] = -corners[0];
    pads[1] = -corners[1];
    pads[2] = corners[2] - im.width;
    pads[3] = corners[3] - im.height;

    const maxPad = Math.max(...pads);
    const npads = maxPad < 0 ? 0 : maxPad;

    if (npads === 0) {
      // Skip the padding and shortcut to resize
      // Saving a few ms spent in drawing simply to padding canvas
      // TODO make sure any edits here happen in the below section as well
      this.outputCanvas.width = model_sz;
      this.outputCanvas.height = model_sz;
      this.outputCtx.drawImage(im, corners[0], corners[1],
          corners[2] - corners[0],
          corners[3] - corners[1],
          0, 0,
          model_sz, model_sz);

      return this.outputCtx.getImageData(0, 0, model_sz, model_sz);
    }

    // Padding is non zero, adjust corners to account for it
    corners.forEach((el, index) => corners[index] = Math.max(0, Math.round(el + npads)));

    // Fill the padding canvas with avg color and 
    // Draw the input in the center
    this.padCanvas.width = im.width + (2 * Math.floor(npads));
    this.padCanvas.height = im.height + (2 * Math.floor(npads));

    this.padCtx.fillStyle = `rgb(${avg.r},${avg.g},${avg.b})`;
    this.padCtx.fillRect(0, 0, this.padCanvas.width, this.padCanvas.height);
    this.padCtx.drawImage(im, npads, npads, im.width, im.height);

    // Resize by drawing into another canvas - uses GPU?
    // Make sure the do edits both above and here if so
    this.outputCanvas.width = model_sz;
    this.outputCanvas.height = model_sz;
    this.outputCtx.drawImage(this.padCanvas, corners[0], corners[1],
        corners[2] - corners[0],
        corners[3] - corners[1],
        0, 0,
        model_sz, model_sz);

    return this.outputCtx.getImageData(0, 0, model_sz, model_sz);
  }

  template_step(_kernel) {
    const z_output = tf.tidy(() => {
      // Get net output
      const z_out = this.model.predict(_kernel);
      // and multiply with z_window  (hanning)
      const z_window = z_out.mul(this.z_window);

      //and apply correlation filter
      const z_corr = correlationFilter(
          tf.squeeze(z_window),
          this.cf_target // correlation filter param (a trained param window)
      );
      // HWC
      // Crop (57 -> 25 (margin 16))
      const {0: h, 1: w} = z_corr.shape;
      const z_crop = z_corr.stridedSlice(
          [MARGIN, MARGIN, 0],
          [h - MARGIN, w - MARGIN, 0],
          [1, 1, 1], 
          0, // beginmask (0, 0, 0)
          4  // endmask (0, 0, 1) - get full range on 3rd dim
      )
      return z_crop; // 25 x 25 x 3
    });
    return z_output;
  }

  async step(_instances) {
    let currentScale = Math.floor(_instances.length/2);
    let bestScale = currentScale;
    let bestVal = -Infinity;

    let responses = _instances.map((_instance) => {
      return tf.tidy(() => {
        // Get net output
        const x_out = this.model.predict(_instance);
        const corr_out = this.instance_model.predict(x_out);

        // TODO Bicubic
        return tf.image.resizeBilinear(
            corr_out,
            [UPSCALE_SZ, UPSCALE_SZ]
        );
      });
    });

    await Promise.all(responses.map(async (responseMap, _sidx) => {
      const peak = tf.tidy(() => {
        if (_sidx !== currentScale) {
          // Apply scale penalty to the response map
          responseMap = responseMap.mul(SCALE_PENALTY); 
        }
        return responseMap.max();
      })
      
      const peakVal = await peak.array();
      if (peakVal > bestVal) {
        bestVal = peakVal;
        bestScale = _sidx;
      }
      tf.dispose(peak);
    }));

    const output = tf.tidy(() => {
      let responseMap = responses[bestScale];
      // (x - min)/sum normalize and apply spatial displacement penalty
      const rmin = responseMap.min();
      responseMap = responseMap.sub(rmin);
      const rsum = responseMap.sum();
      responseMap = responseMap.div(rsum.add(1e-16));
      const fOutput = responseMap.mul(1 - WINDOW_INFLUENCE).add(
          this.hannWindow.mul(WINDOW_INFLUENCE)
      );
      return fOutput.reshape([-1]).argMax();
    });

    // avoid_empty_position???

    // Compute bbox displacement
    const index = await output.array();
    const idx = index % UPSCALE_SZ;
    const idy = Math.floor(index / UPSCALE_SZ);

    tf.dispose(output);
    tf.dispose(bestVal);
    responses.forEach(el => tf.dispose(el));

    // get box and scale
    return [
      idx,
      idy,
      bestScale
    ];
  }

  async template(frame, bbox) {

    // Frame is ImageData, bbox is object { x, y, width, height }
    this.inputCanvas.height = frame.height;
    this.inputCanvas.width = frame.width;
    this.inputCtx.putImageData(frame, 0, 0);

    this.cx = bbox.x + (bbox.width / 2.0);
    this.cy = bbox.y + (bbox.height / 2.0);

    this.target_width = bbox.width;
    this.target_height = bbox.height;

    const context = CONST_CONTEXT * (bbox.width + bbox.height);
    this.z_size = Math.sqrt((bbox.width + context)*(bbox.height + context));
    this.x_size = this.z_size * (INSTANCE_SIZE / EXEMPLAR_SIZE);

    this.min_s_x = MIN_S_FACTOR * this.x_size;
    this.max_s_x = MAX_S_FACTOR * this.x_size;
    this.min_s_z = MIN_S_FACTOR * this.z_size;
    this.max_s_z = MAX_S_FACTOR * this.z_size;

    // Get sub image
    const _kernel = tf.tidy(() => {
      return tf.expandDims(
        tf.cast(
          tf.browser.fromPixels(
            this.get_sub_image(
                this.inputCanvas, 
                [this.cx, this.cy], 
                EXEMPLAR_SIZE,
                Math.round(this.z_size),
                AVG,
            )
          ),
          'float32'
        )
      );
    });
    // template step - reset the current template
    this.z_out = this.template_step(_kernel);

    // set weights (25 x 25 x 32 x 1)
    this.instance_model.layers[0].setWeights([
        tf.expandDims(
            tf.squeeze(this.z_out),
            3
        )
    ]);
    tf.dispose(_kernel);
  }

  async track(frame) {
    this.inputCanvas.height = frame.height;
    this.inputCanvas.width = frame.width;
    this.inputCtx.putImageData(frame, 0, 0);

    // TODO Make scale pyramid
    const scaledInstance = SCALE_FACTORS.map(el => el*this.x_size);
    // Extract Crop
    const _instances = await this.get_scale_pyramid(
        this.inputCanvas,
        [this.cx, this.cy], 
        scaledInstance, 
        INSTANCE_SIZE,
        AVG,
    );

    // displacement, scale = step()
    const [idx, idy, scale] = await this.step(_instances);

    // update scale with damping
    this.x_size = Math.max(
        this.min_s_x,
        Math.min(
            this.max_s_x, 
            (1 - SCALE_LR)*this.x_size + SCALE_LR * scaledInstance[scale]));

    // calculate output position
    const dispInResponseX = idx - (UPSCALE_SZ / 2);
    const dispInResponseY = idy - (UPSCALE_SZ / 2);

    const dispInInstanceX = dispInResponseX * (TOTAL_STRIDE / RESPONSE_UP);
    const dispInInstanceY = dispInResponseY * (TOTAL_STRIDE / RESPONSE_UP);

    const dispInImageX = dispInInstanceX * (this.x_size / INSTANCE_SIZE);
    const dispInImageY = dispInInstanceY * (this.x_size / INSTANCE_SIZE);

    this.cx += dispInImageX;
    this.cy += dispInImageY;

    const scaledWidth = SCALE_FACTORS.map(el => el * this.target_width);
    const scaledHeight = SCALE_FACTORS.map(el => el * this.target_height);
    this.target_width = (
        (1 - SCALE_LR) * this.target_width
        + SCALE_LR * scaledWidth[scale]
    );
    this.target_height = (
        (1 - SCALE_LR) * this.target_height 
        + SCALE_LR * scaledHeight[scale]
    );

    _instances.forEach(_instance => tf.dispose(_instance));

    // optionally call template_step and update the template
    if (Z_LR > 0) {
      const _kernel = tf.tidy(() => {
        return tf.expandDims(
          tf.cast(
            tf.browser.fromPixels(
              this.get_sub_image(
                  this.inputCanvas, 
                  [this.cx, this.cy], 
                  EXEMPLAR_SIZE,
                  Math.round(this.z_size),
                  AVG,
              )
            ),
            'float32'
          )
        );
      });
      // update current template
      const z_out_new = this.template_step(_kernel);
      this.z_out = tf.tidy(() => {
        return tf.add(
          this.z_out.mul(1 - Z_LR),
          z_out_new.mul(Z_LR)
        );
      });
      // set weights (25 x 25 x 32 x 1)
      this.instance_model.layers[0].setWeights([
          tf.expandDims(
              tf.squeeze(this.z_out),
              3
          )
      ]);
      const scaledExemplar = SCALE_FACTORS.map(el => el*this.z_size);

      this.z_size = Math.max(
          this.min_s_z,
          Math.min(
              this.max_s_z,
              ((1 - SCALE_LR)*this.z_size + (SCALE_LR * scaledExemplar[scale]))
          )
      );
      tf.dispose(_kernel);
      tf.dispose(z_out_new);  
    }
    return {
      x: Math.round(this.cx + 1 - ((this.target_width - 1) / 2)), // y update
      y: Math.round(this.cy + 1 - ((this.target_height - 1) / 2)), // x update
      width: Math.round(this.target_width), // height update
      height: Math.round(this.target_height), // width update
    };
  }
}